import React from "react";
import { useEffect } from "react";

const Diocese = ({ name }) => {
  useEffect(() => {
    if (name === undefined) {
      window.location.href = "/province";
    }
  }, [name]);

  return (
    <div>
      <h1>Diocese de {name}</h1>
    </div>
  );
};

export default Diocese;
